webpackJsonp([1427],{"./node_modules/json-loader/index.js!./.cache/json/articles-javascript-standard-objects-array-array-isarray.json":function(r,a){r.exports={data:{markdownRemark:{html:'<p>The <code>Array.isArray()</code> method returns <code>true</code> if an object is an array, <code>false</code> if it is not.</p>\n<h2>Syntax</h2>\n<pre><code>Array.isArray(obj)\n</code></pre>\n<h3>Parameters</h3>\n<p><strong>obj</strong> The object to be checked.</p>\n<p><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/isArray">MDN link</a> | <a href="https://msdn.microsoft.com/en-us/LIBRary/ff848265(v=vs.94).aspx">MSDN link</a></p>\n<h2>Examples</h2>\n<pre><code>// all following calls return true\nArray.isArray([]);\nArray.isArray([1]);\nArray.isArray(new Array());\n// Little known fact: Array.prototype itself is an array:\nArray.isArray(Array.prototype); \n\n// all following calls return false\nArray.isArray();\nArray.isArray({});\nArray.isArray(null);\nArray.isArray(undefined);\nArray.isArray(17);\nArray.isArray(\'Array\');\nArray.isArray(true);\nArray.isArray(false);\nArray.isArray({ __proto__: Array.prototype });\n</code></pre>',frontmatter:{title:"Array isArray",parent:"/home/stuart/guides/src/pages/articles/javascript/standard-objects/array/array-isarray/index.md absPath of file"}}},pathContext:{slug:"/articles/javascript/standard-objects/array/array-isarray/"}}}});
